import React, { Component } from 'react';
import {Switch, Route} from 'react-router-dom';
import AppHeader from './components/AppHeader';
import AppBody from './components/AppBody';
import AppFooter from './components/AppFooter';
import './components/style/Main.css'
import Beranda from './components/beranda';
import TentangSaya from './components/tentangsaya';
import Karya from './components/karya';
import Kontak from './components/kontak';
const Inti = () =>  (
    <Switch>
        <Route exact path = "./components/" component={Beranda} />
        <Route path = "./components/beranda" component={Beranda} />
        <Route path = "./components/tentangsaya" component={TentangSaya} />
        <Route path = "./components/karya" component={Karya} />
        <Route path = "./components/kontak" component={Kontak} />

    </Switch>
)

export default Inti;
